    false,nt"url": null,nt"notes": "This dataset was developed for use with
    the Tennessee STATSGO data base as an additional datafile. Each record in the datafile
    relates to a STATSGO MUID number which is assigned to a polygon(s) in the STATSGO
    geographic coverage. Four soil attributes were derived from the COMP and LAYER datafiles
    of STATSGO, all of which are represented as percentages of the particular map unit's
    area. By representing these properties as percentages, a four-color (CMYK) display
    can be utilized to represent the properties more effectively than a single-color
    or grayscale display.",nt"license_title": null,nt"extras": [{ntt"key":
